import React from 'react';
import './RightPanel.css';

function RightPanel()
{
	return(
			<div className="RightPanel">
	          <form className="form">
	            <label className="labels">
	              Cat Name
	              <input type="text" name="name" />
	            </label>
	            <br/>
	            <label className="labels">
	              Cat Image
	              <input type="text"/>
	            </label>
	            <br/>
	            <label className="labels">
	              Cat Clicks
	              <input type="text"/>
	            </label>
	            <br/>
	            <input type="submit" value="Save" />
	            <input type="submit" value="Undo"/>
	          </form>
        	</div>
		);
}

export default RightPanel;
